Hi everyone! Big news… 
I’m opening my own tattoo studio in downtown Middleboro. We’re working on the not-so-fun construction and paper work part now and I’m hoping we’ll be up and running by late Jan/Feb. A big thank you to everyone who’s gotten tattooed by me, bought prints, shared my work or allowed me to be here in some way or another. It wouldn’t be possible without my wonderful clients! If you’d like to support us in this journey, there’s new prints and a gift card ~deal~ up on our studio website! (in my b!0) To artist friends: I’d love, love to have guest artists come through— plenty of room! Follow along on our studio page for updates and more photos to come soon!
